import React from 'react';
import './Admin.css';
import { Bar, Doughnut } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    BarElement,
    ArcElement,
    Tooltip,
    Legend,
} from 'chart.js';

// Register Chart.js components
ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Tooltip, Legend);

function Admin() {
    const barChartData = {
        labels: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'],
        datasets: [
            {
                label: 'Daily User Logins',
                data: [12, 19, 3, 5, 2, 3, 15],
                backgroundColor: '#10b981',
            },
        ],
    };

    const doughnutData = {
        labels: ['Active Users', 'Inactive Users'],
        datasets: [
            {
                data: [300, 150],
                backgroundColor: ['#10b981', '#475569'],
            },
        ],
    };

    const favoriteQuestionsData = {
        labels: [
            'What is a vaccine?',
            'How do mRNA vaccines work?',
            'What is herd immunity?',
            'What are common vaccine side effects?',
            'How are vaccines developed?',
            'What is the difference between a vaccine and a booster?',
            'How effective are COVID-19 vaccines?',
            'Can vaccines prevent variants?',
            'What is a live attenuated vaccine?',
            'Why is vaccination important?',
        ],
        
        datasets: [
            {
                label: 'Top 10 Favorite Questions',
                data: [120, 100, 95, 90, 85, 80, 75, 70, 65, 60],
                backgroundColor: [
                    '#1e293b',
                    '#3b82f6',
                    '#0ea5e9',
                    '#22d3ee',
                    '#06b6d4',
                    '#0f766e',
                    '#10b981',
                    '#a3e635',
                    '#eab308',
                    '#ef4444',
                ],
                borderRadius: 8,
            },
        ],
    };

    return (
        <div className="admin-content admin-dashboard">
            <h1>Welcome to the Admin Dashboard</h1>
            <p>Use the sidebar to navigate to different sections.</p>

            {/* Info Boxes */}
            <div className="info-boxes">
                <div className="info-box">
                    <h3>Total Users</h3>
                    <p>450</p>
                </div>
                <div className="info-box">
                    <h3>New Signups</h3>
                    <p>35</p>
                </div>
                <div className="info-box">
                    <h3>Reports Pending</h3>
                    <p>12</p>
                </div>
            </div>

            {/* Daily Logins and User Status */}
            <div className="graphs">
                <div className="graph-container">
                    <h3>Daily Logins</h3>
                    <Bar data={barChartData} />
                </div>
                <div className="graph-container">
                    <h3>User Status</h3>
                    <Doughnut data={doughnutData} />
                </div>
            </div>

            {/* Favorite Questions Chart */}
            <div className="favorite-questions-section">
                <h2>Top 10 Favorite Questions</h2>
                <p>This chart shows the top 10 most liked questions on the platform.</p>
                <div className="favorite-questions-chart">
                    <Bar
                        data={favoriteQuestionsData}
                        options={{
                            responsive: true,
                            maintainAspectRatio: false,
                            plugins: {
                                legend: {
                                    display: false,
                                },
                                tooltip: {
                                    callbacks: {
                                        label: (context) =>
                                            `${context.label}: ${context.raw} asked`,
                                    },
                                },
                                title: {
                                    display: true,
                                    text: 'Top 10 Questions',
                                    font: {
                                        size: 22,
                                    },
                                },
                            },
                            animation: {
                                duration: 2000,
                                easing: 'easeOutBounce',
                            },
                            scales: {
                                x: {
                                    ticks: {
                                        color: '#1e293b',
                                    },
                                    grid: {
                                        color: '#e5e7eb',
                                    },
                                },
                                y: {
                                    ticks: {
                                        color: '#1e293b',
                                    },
                                    grid: {
                                        color: '#e5e7eb',
                                    },
                                },
                            },
                        }}
                    />
                </div>
            </div>
        </div>
    );
}

export default Admin;
